import React, { Component } from "react";
import { MDBTable, MDBTableBody, MDBTableHead } from "mdbreact";

import antiStaticBags from "./product-data/bags/antiStaticBags";
console.log(antiStaticBags);

class App extends Component {
	state = {
		antiStaticBags: antiStaticBags
	};

	render() {
		return (
			// <div>
			// 	{this.state.antiStaticBags.map(item => {
			// 		return item.productNumber;
			// 	})}
			// </div>
<MDBTable striped>
	<MDBTableHead>
		<tr>
			<th>Product Number</th>
			<th>Durability</th>
			<th>Size</th>
			<th>Weight</th>
			<th>Bags Per Case</th>
		</tr>
	</MDBTableHead>
	<MDBTableBody>
		<tr>
			<td>{antiStaticBags.productNumber}</td>
			<td>{antiStaticBags.durability}</td>
			<td>{antiStaticBags.sizeWxL}</td>
			<td>{antiStaticBags.weight}</td>
			<td>{antiStaticBags.bagPerCase}</td>
		</tr>
	</MDBTableBody>
</MDBTable>

		);
	}
}

export default App;
